document.getElementById("certificateForm").addEventListener("submit", function (event) {
    event.preventDefault();
 // Retrieve the query parameter from the URL
        const urlParams = new URLSearchParams(window.location.search);
        const wpm = urlParams.get('wpm'); // Get 'message' parameter
        const mpm = urlParams.get('mpm'); 
        const cpm = urlParams.get('cpm'); 

        // Display the received message
        document.getElementById('wpm').innerText = `WPM Message: ${wpm}`;
        document.getElementById('mpm').innerText = `MPM Message: ${mpm}`;
        document.getElementById('cpm').innerText = `CPM Message: ${cpm}`;
    // Get values from the form
    const name = document.getElementById("name").value;
    const date = document.getElementById("date").value;


    // Validate inputs
    if (name === "" ) {
        alert("Please fill in all fields.");
        return;
    }

    // Create the PDF
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

    // Load the logo and badge images
    const logoUrl = 'data:image/png;base64,'; // replace with your logo URL or base64 image
    const badgeUrl = 'data:image/png;base64,';

    // Add Logo at the top
    doc.addImage(logoUrl, 'PNG', 90, 05, 40, 25, undefined, 'NONE');  // Position and size (x, y, width, height)
    doc.setFont("helvetica", "bold")
    doc.setFontSize(15)

    // Set font size and style for the certificate title
    doc.setFontSize(24);
    doc.setFont("helvetica", "bold");
    doc.text("Certificate of Completion", 105, 70, null, null, "center");

    // Add name
    doc.setFontSize(18);
    doc.text(`This is to certify that`, 105, 100, null, null, "center");
    doc.setFontSize(22);
    doc.text(name, 105, 120, null, null, "center"); // righ-left, up-down

    doc.setFontSize(14);
    doc.text('Has been successfully completed typing practice', 80, 125, null, null, "center"); // righ-left, up-down


// Add wpm
    doc.setFontSize(14);
    doc.text(`Word Per Minute: ${wpm}   Mistakes Per Minute: ${mpm}   Characters Per Minute: ${cpm}`, 100, 160, null, null, "center");

    // Add date
    doc.setFontSize(16);
    doc.text(`on the date: ${date}`, 105, 150, null, null, "center"); // righ-left, up-down

    // Add badge image at the bottom (or anywhere you want)
    doc.addImage(badgeUrl, 'PNG', 105, 170, 50, 50, undefined, 'NONE'); // Adjust the size and position
    doc.setFontSize(14)
   // doc.text("RuhulTyping", 115, 195, null, null); // Adjust the size and position

    // Add footer text
    doc.setFontSize(12);
    doc.text("Thank you for participating!", 105, 225, null, null, "center");  // righ-left, up-down

    // Make the download button visible
    document.getElementById("downloadBtn").style.display = "block";

    // Set up download action
    document.getElementById("downloadBtn").onclick = function () {
        doc.save(`${name}_kktyping.pdf`);
    };
});
